import React from 'react';
import './About.css';
import yourImage from './about_images/image1.JPG'; // Replace with the path to your image

const About = () => {
  return (
    <section className="about-section" id="about">
      <h2>About Me</h2>
      <div className="about-content">
        <div className="about-image">
          <img src={yourImage} alt="Your Name" />
        </div>
        <div className="about-text">
          <p>Hello, my name is [Your Name]. I'm a [Your Profession].</p>
          {/* Add more text about yourself here */}
        </div>
      </div>
    </section>
  );
}

export default About;
